import React from "react";

function sum(x, y) {
  const z = x + y;
  return z;
}

function sub(a, b) {
  const c = a - b;
  return c;
}

function div(d, e) {
  const f = d / e;
     f=f.toFixed(2);
  return f;
}

function mul(h, i) {
  const j = h * i;
  return j;
}

export default sum;
export { sub, div, mul };
